import React from 'react';
import { Link } from 'react-router-dom';

function Home({ deckList, setDeckList }) {
  return (
    <div>
      <Link to='/decks/new' className="btn btn-primary btn-lg">+Add Deck</Link>
    </div>
  )
}

export default Home
